        private void InitializeDetail(TotalQueryResult queryResult)
        {
            foreach (var headRow in queryResult.DataTables.DeliveryOrderDataTable.Rows)
            {
                if (headRow.Data == null) continue;

                string getDoDetailUrl = $@"http://tang.cdt-ec.com/yuncai/order/delivery/getDetail?id={headRow.Data.Id}";

                string jsonResult = HttpRequestHelper.Get(getDoDetailUrl, Cookie, Encoding.UTF8);

                DoDetailQueryResult detailResult = JsonConvert.DeserializeObject<DoDetailQueryResult>(jsonResult.Replace("_", ""));

                detailResult.HeadDoData = headRow.Data;

                _doDetails.Add(detailResult);

                _doCount++;

                PrintLog($@"发货管理 正在加载，第：{_doCount} 条" + "\n");
            }
        }

