                string jsonResult = HttpRequestHelper.Post(SoPostUrl, postData, Cookie, Encoding.UTF8);

                SoDetailQueryResult detailResult = JsonConvert.DeserializeObject<SoDetailQueryResult>(jsonResult.Replace("_", ""));

                detailResult.HeadSoData = headRow.Data;

                string orderOtherId = headRow.Data.OrderOtherId;

                if (!string.IsNullOrWhiteSpace(orderOtherId))
                {
                    string isUploadResult = HttpRequestHelper.Get(IsUploadFileUrl + orderOtherId, Cookie, Encoding.UTF8);

                    IsUploadFileResult isUploadFileResult = JsonConvert.DeserializeObject<IsUploadFileResult>(isUploadResult);

                    if (isUploadFileResult.Result.Equals("fail", StringComparison.OrdinalIgnoreCase))
                    {
                        detailResult.IsUploadFile = false;
                        detailResult.IsUploadFileDisplayNote = "否";
                    }
                    else
                    {
                        detailResult.IsUploadFile = true;
                        detailResult.IsUploadFileDisplayNote = "是";
                    }
                }

                switch (soType)
                {
                    case SoType.UnConfirm:
                        {
                            _soTypeDetails[SoType.UnConfirm].Add(detailResult);

                            _unConfirmSoCount++;

                            PrintLog($@"销售订单 类型：{typeName}，正在加载，第：{_unConfirmSoCount} 条" + "\n");

                            break;
                        }
                    case SoType.Confirmed:
                        {
                            _soTypeDetails[SoType.Confirmed].Add(detailResult);

                            _confirmedSoCount++;

                            PrintLog($@"销售订单 类型：{typeName}，正在加载，第：{_confirmedSoCount} 条" + "\n");

                            break;
                        }
                }
            }
        }

        private void ConvertToSoExcel()
        {
            IWorkbook workbook = new HSSFWorkbook();

            ISheet unConfirmSheet = workbook.CreateSheet("未确认");

            ISheet confirmedSheet = workbook.CreateSheet("已确认");

            List<SoExportToExcelModel> unConfirmModels = _soTypeDetails[SoType.UnConfirm].SelectMany(SoExportToExcelModel.Convert).ToList();

            List<SoExportToExcelModel> confirmedModels = _soTypeDetails[SoType.Confirmed].SelectMany(SoExportToExcelModel.Convert).ToList();

            FillSheetData(unConfirmSheet, unConfirmModels);

            FillSheetData(confirmedSheet, confirmedModels);

            string dir = Environment.GetFolderPath(Environment.SpecialFolder.DesktopDirectory);

            string exportFileName = $@"{dir}\大唐电子商务销售订单信息{DateTime.Now:yyyyMMdd}.xls";

            using (FileStream url = File.OpenWrite(exportFileName))
            {
                workbook.Write(url);
            }

            string uploadFilePath = $@"{dir}\附件信息";

            if (!Directory.Exists(uploadFilePath))
            {
                Directory.CreateDirectory(uploadFilePath);
            }

            foreach (var groupModel in unConfirmModels.Where(model => model.IsUploadFile).GroupBy(model => model.OtherOrderId))
            {
                string orderId = groupModel.Key;

                string fileName = $@"未处理-附件{orderId}.xls";

                HttpRequestHelper.HttpDownloadFile(DownloadFileUrl + orderId, uploadFilePath, fileName, true);
            }

            //foreach (var groupModel in confirmedModels.Where(model => model.IsUploadFile).GroupBy(model => model.OrderId))
            //{
            //    string orderId = groupModel.Key;

            //    string fileName = $@"已处理-附件{orderId}.xls";

            //    HttpRequestHelper.HttpDownloadFile(DownloadFileUrl + orderId, uploadFilePath, fileName, true);
            //}

            PrintLog($@"未确认数据，实际生成：{_unConfirmSoCount} 条" + "\n");

            PrintLog($@"已确认数据，实际生成：{_confirmedSoCount} 条" + "\n");

            PrintLog("Excel生成完成");

            btnLoadSOData.Enabled = true;
            btnLoadDOData.Enabled = true;
        }


        private void ConvertToDoExcel()
        {
            IWorkbook workbook = new HSSFWorkbook();

            ISheet allDoSheet = workbook.CreateSheet("全部");

            List<DoExportToExcelModel> allDoModels = _doDetails.SelectMany(DoExportToExcelModel.Convert).ToList();

            FillSheetData(allDoSheet, allDoModels);

            string dir = Environment.GetFolderPath(Environment.SpecialFolder.DesktopDirectory);

            string exportFileName = $@"{dir}\大唐电子商务发货管理信息{DateTime.Now:yyyyMMdd}.xls";

            using (FileStream url = File.OpenWrite(exportFileName))
            {
                workbook.Write(url);
            }

            PrintLog($@"发货管理数据，实际生成：{_doCount} 条" + "\n");

            PrintLog("Excel生成完成");

            btnLoadSOData.Enabled = true;
            btnLoadDOData.Enabled = true;
        }

        /// <summary>
        /// 填充Sheet数据
        /// </summary>
        /// <param name="sheet"></param>
        /// <param name="exportToExcelModels"></param>
        private void FillSheetData(ISheet sheet, List<SoExportToExcelModel> exportToExcelModels)
        {
            IRow headRow = sheet.CreateRow(0);

            headRow.CreateCell(0).SetCellValue("销售订单号");
            headRow.CreateCell(1).SetCellValue("采购订单号");
            headRow.CreateCell(2).SetCellValue("采购组织");
            headRow.CreateCell(3).SetCellValue("订单日期");
            headRow.CreateCell(4).SetCellValue("订单内容");
            headRow.CreateCell(5).SetCellValue("总金额");
            headRow.CreateCell(6).SetCellValue("状态");
            headRow.CreateCell(7).SetCellValue("商品编码");
            headRow.CreateCell(8).SetCellValue("商品名称");
            headRow.CreateCell(9).SetCellValue("数量");
            headRow.CreateCell(10).SetCellValue("单位");
            headRow.CreateCell(11).SetCellValue("无税单价");
            headRow.CreateCell(12).SetCellValue("含税单价");
            headRow.CreateCell(13).SetCellValue("可发货数量");
            headRow.CreateCell(14).SetCellValue("已发货数量");
            headRow.CreateCell(15).SetCellValue("收货地址");
            headRow.CreateCell(16).SetCellValue("收货人");
            headRow.CreateCell(17).SetCellValue("联系方式");
            headRow.CreateCell(18).SetCellValue("是否上传附件");

            int index = 1;

            foreach (var exportModel in exportToExcelModels)
            {
                IRow row = sheet.CreateRow(index);

                row.CreateCell(0).SetCellValue(exportModel.OrderNo);
                row.CreateCell(1).SetCellValue(exportModel.OtherOrderId);
                row.CreateCell(2).SetCellValue(exportModel.OrgName);
                row.CreateCell(3).SetCellValue(exportModel.OrderTime);
                row.CreateCell(4).SetCellValue(exportModel.SaleOrderDetailInfo);
                row.CreateCell(5).SetCellValue(exportModel.TotalMoney);
                row.CreateCell(6).SetCellValue(exportModel.OrderStatusName);
                row.CreateCell(7).SetCellValue(exportModel.SkuCode);
                row.CreateCell(8).SetCellValue(exportModel.SkuName);
                row.CreateCell(9).SetCellValue(exportModel.Quantity.ToString("N0"));
                row.CreateCell(10).SetCellValue(exportModel.Unit);
                row.CreateCell(11).SetCellValue(exportModel.Price.ToString("N2"));
                row.CreateCell(12).SetCellValue(exportModel.TaxPrice.ToString("N2"));
                row.CreateCell(13).SetCellValue(exportModel.Deliveryleftnum.ToString("N0"));
                row.CreateCell(14).SetCellValue(exportModel.DeliveredNum.ToString("N0"));
                row.CreateCell(15).SetCellValue(exportModel.DeliverAddress);
                row.CreateCell(16).SetCellValue(exportModel.PersonName);
                row.CreateCell(17).SetCellValue(exportModel.Mobile);
                row.CreateCell(18).SetCellValue(exportModel.IsUploadFileDisplayNote);

                index++;
            }
        }

