        /// </summary>
        /// <param name="log"></param>
        private void PrintLog(string log)
        {
            if (ResultTextBox.InvokeRequired)
            {
                DelegatePrintLogOut printLogOut = PrintLog;

                Invoke(printLogOut, log);
            }
            else
            {
                ResultTextBox.AppendText(log);
            }
        }
